jQuery.sap.declare("sap.ui.demokit.icex.util.Sorter");

sap.ui.demokit.icex.util.Sorter = {
	
	sortByName : function(a, b) {
		if (!a || !a.name) {
			return -1;
		} else if (!b || !b.name) {
			return 1;
		} else {
			var aName = a.name.toLowerCase();
			var bName = b.name.toLowerCase();
			
			if (aName < bName) {
				return -1;
			} else {
				return (aName > bName) ? 1 : 0;
			}
		}
	}
 };

