			doc : classDoclet && (classDoclet.classdesc || classDoclet.description),
			deprecation : classDoclet && classDoclet.deprecated,
			since : classDoclet && classDoclet.since,
			experimental : classDoclet && classDoclet.experimental,
			properties : {},
			aggregations : {},
			associations : {},
			events : {},
			methods : {}
