					name: n,
					doc : doclet && doclet.description,
					deprecation :doclet && doclet.deprecated,
					since : doclet && doclet.since,
					experimental : doclet && doclet.experimental,
					visibility : (settings.visibility && settings.visibility.value.value) || "public",
